import axios from 'axios';

interface Props {
	user: string;
	token: string
}

const SubmitReview = async ({user, token}: Props) => {
	const reviewData = {
		review: "wow it was great"
	}
	try {
  	const response = await axios.put("http://0.0.0.0:8000/d790c144-5da2-4ef5-b278-e4840b0349f3/review/", reviewData, {
    headers: {
      Authorization: `Bearer ${token}`,
    },
  });
	console.log(response);
	}
  	catch (error) {
	  console.log("review failed");
		console.log(error);
	  console.log(token);
  };
};

export default SubmitReview;
